import React from 'react';
import { Link } from 'react-router-dom';
import './index.css';

export default function Landing() {
	return (
		<div>
			<h3>Welcome to The Recipes Web Page</h3>
			<Link to='/home' id='start'>
				{' '}
				<button className='starting'>Get Started</button>
			</Link>
		</div>
	);
}
